import React, {useState} from "react";

export default function Signin(){
    const imageFilePath = 'https://images.unsplash.com/photo-1553095066-5014bc7b7f2d?ixlib=rb-1.2.1&ixid=MnwxMjA3fDB8MHxwaG90by1wYWdlfHx8fGVufDB8fHx8&auto=format&fit=crop&w=1171&q=80';
        return (
            <>
                <div class="w-full bg-center bg-cover" style={{ backgroundImage: "url('file://${imageFilePath}')" }}>
                    <h1>Hello World</h1>
                </div>
            </>
        );
}
